import React from 'react';

const PurchaseOrders: React.FC = () => {
  return (
    <div className="space-y-6">
      <div>
        <h1 className="text-2xl font-bold text-gray-900">Purchase Orders</h1>
        <p className="text-gray-600">Manage purchase orders and supplier relationships.</p>
      </div>

      <div className="card p-8 text-center">
        <h3 className="text-lg font-medium text-gray-900 mb-2">Purchase Order Management</h3>
        <p className="text-gray-600">This module will include PO creation, supplier management, and procurement tracking.</p>
      </div>
    </div>
  );
};

export default PurchaseOrders;
